 import React from "react"
function Navi(){
   return(
       <div>
           <label>email:</label>
           <input type="email" placeholder="email"/>
           <br/><br></br>
           <label>password:</label>
           <input type="password" placeholder="password"/>
           <br/><br></br>
       </div>
   )
}
export default Navi;
